import React, {Component} from 'react';
import {Container, Row, Col, Card, Button} from 'react-bootstrap';
import Top from './Top';

class App extends Component {
  render(){
  return (
    <div>
      <Top/>
    <Container>
      <Row className="mt-5">
        <Col>
        <h2 className="text-success">Komik</h2>
        <hr></hr>
        <Card style={{ width: '15rem' }}>
          <Card.Img variant="top" style={{height: '300 px'}} src="https://images.unsplash.com/photo-1544716278-ca5e3f4abd8c?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=2767&q=80" />
          <Card.Body>
            <Card.Title>Naruto</Card.Title>
            <Card.Text>
              <p className="text-white-50">Masashi Kishimoto</p>
            </Card.Text>
            <Button variant="primary"style={{width: '100%'}}>Detail</Button>
          </Card.Body>
      </Card>
        </Col>
      </Row>
    </Container>
    </div>
  );
}
}

export default App;
